  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:19.966360\",\n\t\"name\": \"the-effect-of-oil-pollution-on-marine-mammals\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The disastrous effect of petroleum products
  on marine birds is well known. Hundreds of thousands, perhaps millions, have perished
  because of man-made oil spills in the last 30 years. Little is known, however, of
  the long-term effect of the increasing petroleum pollution of the marine environment
  on marine mammals. To my knowledge, no extensive experimental studies of the effect
  of various petroleum products on different marine mammals have been conducted. The
  following observational information, however, is available of marine mammals that
  have accidentally come in contact with petroleum.\",\n\t\"license_title\": \"License
